import React from "react";
import "./newUser.css";

class NewUser extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    if (!this.props.showNewUserModal) {
      return null;
    }
    return (
      <div class="modal" id="modal">
        <div class="content">
          <h1>Hola modal</h1>
        </div>
        <div class="actions">
          <button class="toggle-button">OK</button>
        </div>
      </div>
    );
  }
}

export default NewUser;
